import React from 'react';
import './App.css';
import {BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';
import Home from "./pages/Home.jsx"
import StateManagement from "./pages/StateManagement.jsx"
import FormsAndValidation from "./pages/FormsAndValidation.jsx"
import Hooks from "./pages/Hooks.jsx"
import ApiIntegration from "./pages/ApiIntegration.jsx"
function App() {
  return (
    <Router className='app'>
      <nav className='nav'>
      <Link className="link" to="/">Home</Link>
      <Link to="/hooks">Hook</Link>
      <Link to="/api-integration">Api Integration</Link>
      <Link to="/forms-and-validation">Forms and Validation</Link>
      <Link to="/advance-react">Advance React</Link>
      </nav>
      <Routes>
        <Route path="/" element={<Home/>}/>
        <Route path="/advance-react" element={<StateManagement/>}/>
        <Route path="/forms-and-validation" element={<FormsAndValidation/>}/>
        <Route path="/hooks" element={<Hooks/>}/>
        <Route path="/api-integration" element={<ApiIntegration/>}/>
      </Routes>
    </Router>
  );
}

export default App;
